OMSCHRIJVING:
The Environmental Sciences BSc programme covers environmental and sustainability issues, i.e. problems caused by the interaction of human systems and Earth systems. Environmental sciences are applied in the detection and analysis of (potential) problems, but also in the design, development and evaluation of solutions to these problems. Environmental and sustainability issues have societal causes and consequences that are linked through physical, chemical, and biological processes that operate on planet Earth. Their scientific study therefore requires knowledge and understanding of the terminology, principles, and methods of both natural and social sciences. In the common part, students get a solid foundation in natural sciences and mathematics, become familiar with the most important disciplinary approaches to environmental issues, are trained in interdisciplinary problem-oriented research, develop academic skills in an environmental context, and acquire international experience. In their specialisation, they can zoom in on environmental social sciences, natural sciences or technology, according to their interest and aptitude.  
The programme offers a choice between three specialisations:  
- Environmental Policy and Economics, focusing on the societal causes of environmental and sustainability issues, and on socio-political arrangements and economic instruments for prevention and control;  
- Environmental Quality and Systems Analysis, focusing - within a systems approach framework - on the processes in and between the environmental compartments soil, water, and air that determine the fate of contaminants and their effects on organisms and ecosystems;  
- Environmental Technology, focusing on the application of biological, physical, and chemical processes in techniques aimed at improving environmental quality, preventing or controlling emissions, and recovering valuable resources for reuse.  
Free space in the third year allows the students to create a distinct profile for themselves, enhance their international experience, or become acquainted with other fields of study.

In the 21st century, earth and environment scientists are facing the societal challenge of providing information about the causes and characteristics of earth changes and its effects on the functioning of ecosystems on a human time scale: centuries, decades, or less. This challenge demands an excellent educational programme for students, to provide them with state-of-the-art skills, sound knowledge of system functioning, and an attitude that allows them to work in multi-disciplinary teams.  

The focus of the MSc programme Earth and Environment is on the earth's 'Critical Zone' -including the atmospheric boundary layer- where flows of energy and matter determine the conditions for sustaining life. There is growing recognition within science and society of the complex dependencies and relationships existing within this zone. Major global themes like climate change, food security, the provision of water and biodiversity require input from graduates with strong disciplinary backgrounds who, at the same time, have the skills to work together with scientists from other disciplines. The programme embodies the vision that disciplinary elements can and should be brought together within one study programme, with opportunities for students to become strong in their discipline (the fundamental columns of soil, water & atmosphere) but also to provide them with opportunities to connect with other disciplines.  

Students develop advanced skills in measurements, modelling and analysis, and pay due attention to methods for up- and downscaling and scenario analysis. They learn to think in ranges of temporal and spatial scales and are introduced to modern concepts such as spatial and temporal statistics, C and N cycling, and hydrological connectivity.  
The programme not only focuses on the core disciplines of soil science, hydrology and meteorology but also on ecological aspects and, especially, integration. Using tools and concepts from physics, mathematics, chemistry, biology and geography, a quantitative understanding is built of the composition, structures and processes of the upper Earth's zone and its atmosphere. Given the profound impacts of contemporary human activities on the environment at multiple spatial and temporal scales, emphasis is especially paid to the influences of human activity on earth surface patterns and processes.  

Students are able, following two common starter courses, to design their study based on their own preferences. They specialize by selecting a specialization, a thesis subject, its preparatory courses and several elective courses. In this way students can focus on:

* (a) Hydrology and Water Resources;
* (b) Meteorology and Air Quality;
* (c) Biology and Chemistry of Soil and Water;
* (d) Soil Geography and Earth Surface Dynamic

The MSc programme Environmental Sciences has been designed for students who want to take up the challenge of finding innovative approaches to improve the state of the environment and sustainable solutions to the threats it faces. The programme provides insight into the socio-economic causes, the characteristics, and the impact of pollution and degradation of the natural environment. Students learn how to integrate knowledge and skills in dealing with complex environmental issues that are characterized by uncertainties, diverging social interests, and by conflicting views on their nature and the best ways to solve them. By taking an interdisciplinary approach, they learn to develop analytical tools and models, environmental technologies, socio-political arrangements, and economic instruments to control and prevent these issues.  

The programme provides its students with an opportunity of advanced academic training, emphasising the development of a critical attitude and analytical and problem-solving skills, and of gaining more in-depth knowledge of a comprehensive range of environmental disciplines. Its target groups are recently qualified BSc graduates with basic academic training as well as mid-career environmental professionals. The classroom is truly international; due attention is given to the development of intercultural communication skills. The programme is thesis-oriented with an individual research project as its core. Compulsory elements are kept at a minimum, thus enabling the programme to be tailored to the wishes and needs of the individual student.   
Eleven different disciplines offer the possibility of major thesis research within this programme. They are offered via four specialisations:  
- Environmental Quality: Air quality and atmospheric chemistry, Aquatic ecology and water quality, Soil biology, Soil chemistry and chemical soil quality, Environmental toxicology and Marine animal ecology;  
- Environmental Policy and Economics: Environmental policy, and Environmental economics and natural resources;  
- Environmental Technology: Environmental technology;  
- Human-Environmental Systems: Environmental systems analysis, and Water systems and global change.  

Experimental thesis research will usually be part of on-going research programmes of WUR departments or research institutes. Otherwise, thesis topics are the initiative of the student or the result of discussions between the student and potential supervisors.  

Students have the opportunity of acquiring knowledge of, and experience in, environmental education and communication (track) and they can opt for one of the career orientations, including consultancy, capacity building, entrepreneurship, international relations, and research.

The MSc Landscape Architecture and Planning programme trains students to become innovative leaders in the field of landscape architecture and spatial planning. The programme focuses on understanding and managing the complex relationships between humans, non-humans and landscapes. It combines professional design and spatial planning skills with the ability to conduct research and reflect on design, planning and research results. The programme focuses primarily on rural-urban landscapes, considered in their dynamics and global context of cultural, ecological, technological, economic and political transformation.

The programme addresses key challenges that determine and necessitate important landscape transitions, for example:

* the effects of climate change (including urban climate and liveability / flood risk management);
* the growing needs for sustainable and accessible energy sources;
* the demand for local food production within metropolitan areas;
* the impacts of globalisation on spaces and places.

The programme enable students to approach such challenges in different ways, depending on personal ambitions as a future designer, spatial planner, consultant, policy-maker and/or researcher.
